package eu.throup.advent2020.day20

import org.scalatest.freespec.AnyFreeSpec

class day20Spec extends AnyFreeSpec {
  "day 20 - part 1" - {
    "define the api" - {
      "takes a string as input" in {
        part1(exampleInput)
      }
      "returns an Long as output" in {
        val output: Long = part1(exampleInput)
      }
    }

    "examples" - {
      "Instruction example" in {
        val input = exampleInput
        val output = part1(input)

        assert(output == 20899048083289L)
      }

      "Task set" in {
        val input = challengeInput
        val output = part1(input)

        assert(output == 17032646100079L)
      }
    }
  }

  "day 20 - part 2" - {
    "define the api" - {
      "takes a string as input" in {
        part2(exampleInput)
      }
      "returns an Int as output" in {
        val output: Long = part2(exampleInput)
      }
    }

    "examples" - {
      "Instruction example 1" in {
        val input = exampleInput
        val output = part2(input)

        assert(output == 273)
      }

      "Task set" in {
        val input = challengeInput
        val output = part2(input)

        assert(output == 2006)
      }
    }
  }

